import "./app.scss"
import Home from "./home/Home";

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

// Default route is home
const App = () => {
    return (
    <Router>
      <Routes>

        <Route path="/">
          <Home />
        </Route>

        <Route path="/movies">
          <Home />
        </Route>


      </Routes>
    </Router>
  );
};

export default App;
